import React from "react"

class Comp extends React.Component{
    constructor(props){
    super(props);
    this.state ={
        name:"Vasile",
        age : "20",
        isLoggedIn : false
        };  
    }

    mouseDown() {
        console.log("mouse over here");
    }
    render()
    {
        
        return(
            <div>
                <img src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__340.jpg"></img>
            </div>
        )
    }
}

export default Comp
